import React, {Component} from 'react';

class Nav extends Component{
  render(){
    return(
      <header>
        <container>
          <h1>Internal Medicine</h1>
        </container>
        <nav>
          <ul>
            <li><a>Home Page</a></li>
            <li><a>About Us</a></li>
            <li><a>Home Page</a></li>
          </ul>
        </nav>
      </header>
    );
  }
}

export default Nav;
